import React from 'react';
import Book from './Book';

const Slelf = ({ Books, title, updateBookShelf }) => {




    return(

        <div className="bookslelf">
            <h2 className="bookslelf-title">{title}</h2>
            <div className="bookslelf-books">
                <ol className="books-grid">
                    {Book.map(b => (
                        <li key={b.id}>
                            <Book book={b} changeBookShelf={updateBookShelf} />
                        </li>
                    ))}

                </ol>
            </div>
        </div>

    )

}
export default Slelf;
